import "./Hero.css";
function Hero() {
  return (
    <div className="main-banner">
      <div className="hero-text"></div>
      <h6 className="hero_subtitle">Welcome to cyborg</h6>
      <h4 className="hero-title">
        <em>Browse</em> Our
        ,br
        <br /> Popular Games Here
      </h4>
      <div className="hero-button">
        <a href="browse.html"> Browse Now</a>
      </div>
    </div>
  );
}

export default Hero;
